import React from 'react';
import {Grid, Paper} from '@material-ui/core'
import './Home.css';

function Home(){
    return(
        <>
           <Grid container>
            <Grid item xs={12} sm={8}> 
                    <Paper style={{height: "100vh", background: "lightpurple"}} />
            </Grid>
            <Grid item container xs={12}>
                <Grid item>
                      <Paper style={{height: "49vh", background: "red"}}  />
                 </Grid>
                <Grid item> 
                     <Paper style={{height: "100vh", background: "orange"}}  />
                </Grid>
            </Grid>
           </Grid>
        
        </>
    );
}

export default Home;
